import React from "react";
import styles from '../styels/navebar.module.css';

const Navbar = () => {
    return (
        <div className={styles.navebar}>
            <span className={styles.logo}>Let's Chat!
            </span>
            <div className={styles.user}>
                <img src="" alt=""/>
                <span>Sid</span>
            </div>
        </div>
    )
}

export default Navbar;
